function Interview() {

  return(
    <div>
      {/* <WebGazer /> */}
      <Stack direction="column" spacing={2} alignItems= "center">
        <Box sx={{ backgroundColor: "white", height: "73px"}}>
          <Navbar />
        </Box>

        <Box sx={{ backgroundColor: "white", height: "680px", alignItems: "center"}}>
          <Avatar />
        </Box>

        <Box sx={{ backgroundColor: "white", height: "80px"}}>
          <SpeechReader />
        </Box>

        <Box sx={{ backgroundColor: "white", height: "60px"}}>
          <SpeechToText />
        </Box>
      </Stack>
    </div>
  );
};

export default Interview;
